  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for National
  Elk Refuge outlines Refuge accomplishments during the 1964 calendar year. The report
  begins by summarizing the weather conditions and habitat conditions during the year.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  predators, rodents, raptors, and diseases- is also covered. The Refuge development
  and maintenance section discusses physical developments and plantings. Resource
  management is outlined; topics include grazing. The public relations section of
  the report describes recreational uses, Refuge visitors, Refuge participation, and
  hunting. Items of interest, N-R forms, and photographs are attached.\",\n\t\"owner_org\":
